import React from 'react';
import { Link } from 'react-router-dom';

function Deposit(){
    return (
        <div className='container'>
            <div className='form-area'>
                <h1>Deposit</h1>
                <form action='#' method='post'>
                    <input type='number' placeholder='0.00'></input>
                    <div className='row'>

                    </div>
                </form>
            </div>
        </div>
    )
}


export default Deposit;
